Georgia Byrd (Queen Latifah), een verlegen verkoopster van keukengerei uit New Orleans, krijgt te horen dat ze niet lang meer te 
leven heeft. Ze gooit het roer om en besluit een laatste droomvakantie te houden in Europa. Omdat ze denkt dat ze niets meer te 
verliezen heeft, gooit ze alle remmen los. Georgia's persoonlijke transformatie heeft effect op iedereen die in haar buurt komt. 
Ze wil een leven vol plezier leiden in slechts een paar weken.:
